- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XA\x1CThe receipts disclosed on Line
    11(a)(i) identified as 'Contributions, Unitemized' are all contributions that
    aggregate to $199 or less and are now disclosed on Line 11 (a)(ii) of the Detailed
    Summary Page.  The receipt from the US Postmaster in Schedule A supporting Line
    15 offsetting operating expenditures is a refund clearing excess postage in the
    amount of $16,287.49 from Permit 2180 Account in Pittsburgh, PA.  The receipt
    from CobraServ National Service is a refund for COBRA Coverage paid by the individual
    covering the costs incurred by the Committee from Capital Blue Cross.  The payment
    to Capital Blue Cross was made March 27 and appears in Schedule B supporting Line
    21(b) .  The payment to Steve Brown Direct Mail totaling $5,019.63 was direct
    mail generic party fundraising and did not refer to a clearly defined candidate
    for Federal Office or promote, support, attack or oppose any candidate for Federal
    Office.  Payments for Federal Payroll Taxes, Insurance Premium, Payroll Taxes,
    Local Wage Taxes Pension funds and Net Salary were made for staff members spending
    less than 25% of their time on federal election activity or any activities in
    connection with a federal election.  Payments for 'List & Web Development' and
    'List Rental' were made for web consulting and fundraising lists for the state
    party organization and not a specific candidate."
